import { MDBCol, MDBContainer, MDBRow, MDBFooter} from "mdbreact";

const FooterPage = () => {
  return (
      <MDBFooter color="stylish-color-dark" className="font-small pt-4  bg-dark fontifyw">
        <MDBContainer fluid className="text-center text-md-left">
          <MDBRow>
            <MDBCol >
              <p>
                Happy Browsing :)
              </p>
            </MDBCol>
          </MDBRow>
        </MDBContainer>
        <div className="footer-copyright text-center py-3">
          <MDBContainer fluid>
            &copy; {new Date().getFullYear()} Mgrdich Minasain
          </MDBContainer>
        </div>
      </MDBFooter>
  );
};

export default FooterPage;*/


import React from 'react';

const Footer = () => {
    return (
        <div>
            <footer className="footer bg-dark">
                Happy Browsing :)
                <div>

                    <a href="https://github.com/Mgrdich"> </a>


                </div>
                <ul className="nav">
                    <li className="nav-item">
                        <a className="nav-link active" href="#"><i className="fab fa-facebook m-1 fa-2x"/></a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" href="https://github.com/Mgrdich"><i className="fab fa-github m-1 fa-2x"/></a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" href="#">  <i className="fab fa-whatsapp m-1 fa-2x"/></a>
                    </li>

                </ul>
            </footer>
        </div>
    );
};

export default Footer;
